function createDQNModel() {
    const model = tf.sequential();
  
    model.add(tf.layers.dense({inputShape: [4], units: 24, activation: 'relu'}));
    model.add(tf.layers.dense({units: 24, activation: 'relu'}));
    model.add(tf.layers.dense({units: 2, activation: 'linear'}));
  
    model.compile({optimizer: 'adam', loss: 'meanSquaredError'});
  
    return model;
}
  
function sample(array, size) {
    const shuffled = array.slice(0);
    let i = array.length;
    const min = i - size;
    let temp, index;

    while (i-- > min) {
        index = Math.floor((i + 1) * Math.random());
        temp = shuffled[index];
        shuffled[index] = shuffled[i];
        shuffled[i] = temp;
    }

    return shuffled.slice(min);
}

async function trainAndPlay() {
    const numEpisodes = 1000;
    const gamma = 0.95; // discount factor
    let epsilon = 1.0; // exploration rate
    const epsilonDecay = 0.995;
    const epsilonMin = 0.01;
    const batchSize = 32;
    const replayBuffer = [];

    for (let episode = 0; episode < numEpisodes; episode++) {
        restartGame();
        let state = getState();
        let done = false;
        let totalReward = 0;

        while (!done) {
            let action;
            if (Math.random() < epsilon) {
                action = Math.floor(Math.random() * 2); // random action
            } else {
                const qValues = model.predict(tf.tensor2d([state])).dataSync();
                action = qValues.indexOf(Math.max(...qValues));
            }

            console.log('STATE BEFORE', state)
            const nextState = update(action);
            const reward = getReward();
            console.log('STATE AFTER UPD', state)
            // action, reward, nextState
            replayBuffer.push({ state, action, reward, nextState, done: false }); // TODO

            if (replayBuffer.length > 10000) {
                replayBuffer.shift();
            }

            state = nextState;
            totalReward += reward;
            // game.render();

            if (replayBuffer.length > batchSize) {
                console.log('REPLAY BUFFER', replayBuffer)
                const batch = sample(replayBuffer, batchSize);
                const states = batch.map(exp => exp.state);
                const actions = batch.map(exp => exp.action);
                const rewards = batch.map(exp => exp.reward);
                const nextStates = batch.map(exp => exp.nextState);
                const dones = batch.map(exp => exp.done);

                console.log('NEXT STATES', nextStates)
                const qNext = model.predict(tf.tensor2d(nextStates)).arraySync();
                const qTarget = model.predict(tf.tensor2d(states)).arraySync();

                for (let i = 0; i < batchSize; i++) {
                    qTarget[i][actions[i]] = rewards[i] + (dones[i] ? 0 : gamma * Math.max(...qNext[i]));
                }

                await model.fit(tf.tensor2d(states), tf.tensor2d(qTarget), {epochs: 1});
            }

            if (false) {
                done = true;
            }
        }

        epsilon = Math.max(epsilonMin, epsilon * epsilonDecay);
        console.log(`Episode: ${episode}, Total Reward: ${totalReward}`);
    }
}

// game
const scene = {
    preload: preload,
    create: _ => null,
    update: _ => null
}

const gameConfig = {
    type: Phaser.AUTO,
    width: 1920,
    height: 1080,
    physics: {
        default: 'arcade',
        arcade: {
            gravity: false, // { y: 300 },
            debug: false
        }
    },
    scene
};

let player;
let pipes;
let score = 0;
let scoreText;
let spacebar;
let elevationTarget = 0;
let spacePressedRecently = false;

const constantFallSpeed = 500;
const elevationPerPress = 180;
const elevationStep = 18;
const debounceDelay = 100;

const game = new Phaser.Game(gameConfig);

let ctx;

let texturesLoaded = 0;

const model = createDQNModel();

function preload() {
    if (!ctx) {
        const skyB64 = 'data:image/png;base64,'
        this.textures.addBase64('sky', skyB64)

        const birdB64 = 'data:image/png;base64,'
        this.textures.addBase64('player', birdB64)

        const pipeB64 = 'data:image/png;base64,'
        this.textures.addBase64('pipe', pipeB64)

        const resetButtonB64 = 'data:image/png;base64,'
        this.textures.addBase64('resetButton', resetButtonB64)

        this.textures.on('onload', () => {
            // hacky as shit, fix later?
            texturesLoaded++;
            if (texturesLoaded === 3) {
                create.call(this);
                trainAndPlay();
            }
        })
    } else {
        create.call(this);
    }
}

function spawnPipe() {
    let pipeHeight = gameConfig.height / 5;
    let gapSize = 800;
    let gapPosition = Phaser.Math.Between(gapSize, gameConfig.height - gapSize);

    let topPipe = pipes.create(gameConfig.width, gapPosition - gapSize / 2 - pipeHeight, 'pipe');
    let bottomPipe = pipes.create(gameConfig.width, gapPosition + gapSize / 2, 'pipe');
    
    topPipe.setFlipY(true);
    topPipe.body.velocity.x = -450;
    topPipe.setScale(0.6, 1);
    topPipe.body.setSize(230, 540);

    bottomPipe.body.velocity.x = -450;
    bottomPipe.setScale(0.6, 1);
    bottomPipe.body.setSize(230, 540);

    topPipe.passed = false;
    bottomPipe.passed = false;
}

function restartGame() {
    ctx.scene.restart();
}

function create() {
    ctx = this;

    spacebar = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.SPACE);

    const sky = this.add.image(0, 0, 'sky').setOrigin(0, 0);
    sky.setScale(gameConfig.width / sky.width, gameConfig.height / sky.height);

    player = this.physics.add.sprite(300, 400, 'player');
    player.setAlpha(1);
    player.setBounce(1);
    player.setCollideWorldBounds(true);
    player.body.allowGravity = false;
    player.body.setSize(140, 140);

    pipes = this.physics.add.group();

    this.physics.add.collider(player, pipes, hitPipe, null, this);

    scoreText = this.add.text(16, 16, 'score: 0', { fontSize: '32px', fill: '#000' });

    player.setVelocityY(constantFallSpeed);

    // spawn pipes
    this.time.addEvent({
      delay: 2000, // 2 seconds
      callback: spawnPipe,
      callbackScope: this,
      loop: true
    });

    this.gameOverText = this.add.text(gameConfig.width / 2, gameConfig.height / 2, 'Game Over', {
      fontSize: '64px',
      fill: '#ff0000'
    });

    this.gameOverText.setOrigin(0.5, 0.5); // Center the text
    this.gameOverText.setVisible(false);

    this.resetButton = this.add.sprite(gameConfig.width / 2, gameConfig.height - 300, 'resetButton');
    this.resetButton.setInteractive();
    this.resetButton.on('pointerdown', restartGame, this);
    this.resetButton.setVisible(false);
}

function getState() {
    const pc = pipes.getChildren()
    const pipeCoords = []

    for (const p of pc) {
        pipeCoords.push(p.x)
        pipeCoords.push(p.y)
    }

    if (!pipeCoords.length) {
        pipeCoords.push(0)
        pipeCoords.push(0)
    }

    return [player.y, player.body.velocity.y, ...pipeCoords] // does it need to be a static length?
}

function getReward() {
    return this.done ? -1 : 0.1;
}

function gameOver() {
    ctx.physics.pause();
    ctx.gameOverText.setVisible(true);
    ctx.resetButton.setVisible(true);
}

function onBirdPassedPipe() {
    score += 1;
    scoreText.setText('Score: ' + score);
}

function update() {
    if (!ctx) {
        return
    }

    if (Phaser.Input.Keyboard.JustDown(spacebar) && !spacePressedRecently) {
      spacePressedRecently = true;

      elevationTarget -= elevationPerPress;

      this.time.delayedCall(debounceDelay, () => {
        spacePressedRecently = false;
      });

    }

    // it seems default angle is -4
    if (player.angle < 60) { // looking down but not too much
      player.angle += 1;
    }

    if (elevationTarget <= 0) {
      if (player.angle > -60) { // looking up but not too much
        player.angle -= 7;
      }
      player.y -= elevationStep;
      elevationTarget += elevationStep;
    }

    // Top collision
    if (player.y < 30) {
        gameOver();
    }

    // Bottom collision
    if (player.y > gameConfig.height - 100) {
        gameOver();
    }

    // remove pipes off screen
    pipes.getChildren().forEach(pipe => {
        if (pipe.x + pipe.width < 0) {
            pipe.destroy();
        }

        if (player.x > pipe.x && !pipe.passed) {
            pipe.passed = true;
            onBirdPassedPipe();
        }
    });
}

function hitPipe(player, _) {
    gameOver();
}
